import React from 'react';

const Navbar = () => {
  return (
    <nav className='navigation'>
      <ul>
        <li>Dresses</li>
        <li>Jeans</li>
        <li>Tops</li>
        <li>Accessories</li>
        <li>Jackets</li>
        <li>Shoes</li>
      </ul>
    </nav>
  );
}

export default Navbar;
